        }

        map.getPane('pane_IMD_NI_2010_20_0').style['mix-blend-mode'] = 'normal';
        var layer_IMD_NI_2010_20_0 = new L.geoJson(json_IMD_NI_2010_20_0, {

            dataVar: 'json_IMD_NI_2010_20_0',
            layerName: 'layer_IMD_NI_2010_20_0',
            pane: 'pane_IMD_NI_2010_20_0',
